import Vue from 'vue'
import App from './App.vue'

// 注册全局组件
import TypeNav from '@/components/TypeNav'
Vue.component(TypeNav.name, TypeNav)

// 引入路由
import router from '@/router'

// 引入仓库
import store from '@/store'

// 引入mock
import '@/mock/mockServe.js'

// 引入swiper
import 'swiper/swiper.min.css'

new Vue({
  render: (h) => h(App),
  router,
  store,
}).$mount('#app')
